import React from "react";

import Button from '@material-ui/core/Button';
import "../../App.css";





import { useNavigate } from "react-router-dom";


function Index() {
  const navigate = useNavigate();

  const nextPage = (page) => {
    navigate("/"+page);
  }

  return (
      <div>
        <center><h1> <p class="font-weight-bold"style={{ marginTop: "15%" }}>COMPUTATIONAL MATHEMATICS</p></h1></center>
        
        
    <center><h9 >"This project is a project about courses. 
                Computational Mathematics that teachers have taught Is the introduction of various lessons learned And applied until the project came up "</h9>
                </center>  
                <br></br>
        <br></br>       
        <br></br>
        <br></br>
        <br></br>
        <br></br>
        <br></br>
        <br></br>
        <br></br>
        <br></br>
     
    
        <center>
       <Button fullWidth variant="contained" color="secondary"  onClick={()=>{nextPage("/WilawanCommath/main")}} class="p-3 mb-2 bg-warning text-dark"
                    style={{
                      // marginTop: "20px",
                      // marginBottom: "20px",
                      width: 380,
                     }} >
         <h3>GO TO PROJECT</h3>
         
     </Button> 
      </center>
  
      </div>    
     

     
   


  
  



    );
  
}
export default Index;
